/**
https://leetcode.com/problems/find-median-from-data-stream/
295. Find Median from Data Stream My Submissions QuestionEditorial Solution
Total Accepted: 18173 Total Submissions: 81741 Difficulty: Hard
Median is the middle value in an ordered integer list. If the size of the list is even, there is no middle value. So the median is the mean of the two middle value.

Examples: 
[2,3,4] , the median is 3

[2,3], the median is (2 + 3) / 2 = 2.5

Design a data structure that supports the following two operations:

void addNum(int num) - Add a integer number from the data stream to the data structure.
double findMedian() - Return the median of all elements so far.
For example:

add(1)
add(2)
findMedian() -> 1.5
add(3) 
findMedian() -> 2
 */
package algorithms.num295_FindMedianFromDataStream;

import java.util.ArrayList;
import java.util.Collections;
import java.util.Iterator;
import java.util.List;

public class MedianFinder20160629Wed1517 {
	
	List<Integer> ls = new ArrayList<Integer>();

    // Adds a number into the data structure.
    public void addNum(int num) {
        ls.add(num);
    }

    // Returns the median of current data stream
    public double findMedian() {
    	if (ls.isEmpty()) return 0;
    	else if (ls.size() == 1) return ls.iterator().next();
    	else {
    		 Collections.sort(ls);
    	     Iterator<Integer> it = ls.iterator();
    	     int hi;
    	     boolean even = ls.size() % 2 == 0 ? true : false;
    	     if (even) hi = ls.size() / 2 - 1;
    	     else hi = ls.size() / 2;
    	     int i = 0;
    	     while (it.hasNext()) {
    	    	 if (i == hi) {
    	    		if (even) return ((double)it.next() + (double)it.next()) / 2;
    	        		else return (double)it.next();
    	    	 } else it.next();
    	    	 i++;
    	    }
    	    return 0;
    	}
    }
}

